import { useState, useEffect } from "react";

export default function Contact() {
  const [dateUser, setDateUser] = useState([]);

  useEffect(() => {
    fetch(`https://dummyjson.com/users/1`)
      .then((res) => res.json())
      .then((users) => setDateUser(users));
  }, [dateUser]);

  return (
    <div>
      <ul>
        <li>
          <h2>{dateUser.firstName}</h2>
        </li>
      </ul>
    </div>
  );
}
